def build_scoring_matrix(alphabet, diag_score, off_diag_score, dash_score):
	'build a scoring matrix which will be used in project4'
	scoring_matrix={}
	new_alphabet=set(alphabet)
	new_alphabet.add('-') 
	for charactor_row in new_alphabet:
		scoring_matrix[charactor_row]={}
		for charator_col in new_alphabet:
			# print charactor_row,charator_col
			if charactor_row ==charator_col :
				if '-' ==charactor_row:
					scoring_matrix[charactor_row][charator_col]=dash_score
				else:
					scoring_matrix[charactor_row][charator_col]=diag_score
			else:
				if '-' in [charactor_row,charator_col]:
					scoring_matrix[charactor_row][charator_col]=dash_score
				else:
					scoring_matrix[charactor_row][charator_col]=off_diag_score
	return scoring_matrix
def compute_alignment_matrix(seq_x, seq_y, scoring_matrix, global_flag):
	'computes either a global alignment matrix or a local alignment matrix depending on the value of global_flag.'
	len_m=len(seq_x)
	len_n=len(seq_y)
	
	# table=[[0 for dummy_x in range(len_m)] for dummy_y in range(len_n)]
	if len_m==0 or len_n==0:
		return [[0]]
	if global_flag:
		
		gas=computeglobalalignmentscores(seq_x,seq_y,scoring_matrix)
		
	else:
		gas=computelocalalignmentscores(seq_x,seq_y,scoring_matrix)
		
	return gas
	


def computeglobalalignmentscores(seq_x,seq_y,scoring_matrix):
	'compute the socre for alignment matrix '
	len_m=len(seq_x)
	len_n=len(seq_y)
	
	alignment_matrix=[[0 for dummy_x in range(len_n+1)] for dummy_y in range(len_m+1)]
	alignment_matrix[0][0]=0
	for dummy_x in range(1,len_m+1):
		alignment_matrix[dummy_x][0]=alignment_matrix[dummy_x-1][0]+scoring_matrix[seq_x[dummy_x-1]]['-']
	for dummy_y in range(1,len_n+1):
		alignment_matrix[0][dummy_y]=alignment_matrix[0][dummy_y-1]+scoring_matrix['-'][seq_y[dummy_y-1]]
	for dummy_x in range(1,len_m+1):
		for dummy_y in range(1,len_n+1):
			alignment_matrix[dummy_x][dummy_y]=max(alignment_matrix[dummy_x-1][dummy_y]+scoring_matrix[seq_x[dummy_x-1]]['-'],alignment_matrix[dummy_x][dummy_y-1]+scoring_matrix['-'][seq_y[dummy_y-1]],alignment_matrix[dummy_x-1][dummy_y-1]+scoring_matrix[seq_x[dummy_x-1]][seq_y[dummy_y-1]])
	return alignment_matrix

def computelocalalignmentscores(seq_x,seq_y,scoring_matrix):
	'compute the socre for alignment matrix '
	len_m=len(seq_x)
	len_n=len(seq_y)
	alignment_matrix=[[0 for dummy_x in range(len_n+1)] for dummy_y in range(len_m+1)]
	alignment_matrix[0][0]=0
	for dummy_x in range(1,len_m+1):
		alignment_matrix[dummy_x][0]=max(alignment_matrix[dummy_x-1][0]+scoring_matrix[seq_x[dummy_x-1]]['-'],0)
	for dummy_y in range(1,len_n+1):
		alignment_matrix[0][dummy_y]=max(alignment_matrix[0][dummy_y-1]+scoring_matrix['-'][seq_y[dummy_y-1]],0)
	for dummy_x in range(1,len_m+1):
		for dummy_y in range(1,len_n+1):
			alignment_matrix[dummy_x][dummy_y]=max(0,alignment_matrix[dummy_x-1][dummy_y]+scoring_matrix[seq_x[dummy_x-1]]['-'],alignment_matrix[dummy_x][dummy_y-1]+scoring_matrix['-'][seq_y[dummy_y-1]],alignment_matrix[dummy_x-1][dummy_y-1]+scoring_matrix[seq_x[dummy_x-1]][seq_y[dummy_y-1]])
	return alignment_matrix

def computalingment(seq_x,seq_y,scoring_matrix,alignmentscores,golbal):
	'use the correct socre to retun the alingment return_x and return_y'

	len_m=len(seq_x)
	len_n=len(seq_y)
	return_x=''
	return_y=''
	score=0

	if golbal:
		score=alignmentscores[len_m][len_n]
	else:
		for max_score in alignmentscores:
			if score<max(max_score):
				len_m=alignmentscores.index(max_score)
				len_n=max_score.index(max(max_score))
				score=max(max_score)
	while len_m!=0 and len_n!=0:
		
		if alignmentscores[len_m][len_n]==alignmentscores[len_m-1][len_n-1]+scoring_matrix[seq_x[len_m-1]][seq_y[len_n-1]]:
			return_x=seq_x[len_m-1]+return_x
			
			return_y=seq_y[len_n-1]+return_y
			len_m=len_m-1
			len_n=len_n-1
		else:
			if alignmentscores[len_m][len_n]==alignmentscores[len_m-1][len_n]+scoring_matrix[seq_x[len_m-1]]['-']:
				return_x=seq_x[len_m-1]+return_x
				return_y='-'+return_y
				len_m=len_m-1
				
			else:
				return_x='-'+return_x
				return_y=seq_y[len_n-1]+return_y
				len_n=len_n-1
	if golbal:
		while len_m!=0:
			return_x=seq_x[len_m-1]+return_x
			return_y='-'+return_y
			len_m=len_m-1
		while len_n!=0:
			return_y=seq_y[len_n-1]+return_y
			return_x='-'+return_x
			len_n=len_n-1
	return (score,return_x,return_y)
	
def	compute_global_alignment(seq_x, seq_y, scoring_matrix, alignment_matrix):
	'compute the global alignment for input seq_x,seq_y'
	gas=compute_alignment_matrix(seq_x, seq_y, scoring_matrix,True)
	return computalingment(seq_x,seq_y,scoring_matrix,gas,True)
	
def compute_local_alignment(seq_x, seq_y, scoring_matrix, alignment_matrix):
	'compute the local alignment for input seq_x,seq_y'
	gas=compute_alignment_matrix(seq_x, seq_y, scoring_matrix,False)
	score,return_x,return_y=computalingment(seq_x,seq_y,scoring_matrix,gas,False)
	
	if score==0:
		return (0,'','')
	else:
		while '-' ==return_x[0] or '-'==return_y[0]:
			return_x=return_x[1:]
			return_y=return_y[1:]
		while '-' ==return_x[-1] or '-'==return_y[-1]:
			return_x=return_x[:-1]
			return_y=return_y[:-1]
	return (score,return_x,return_y)
